export default function ShopitemTodayStart({ts}){

  function todayStart(ts){
    if(ts === "todayDelivery"){
      return <img className="shopitem_today_start_img" src="https://assets.ohou.se/web/dist/media/assets/icons/ic-departure-today-c4b771c1162afcd9223631b660e19d73.png"/>
    }
    else if(ts === "furnitureDelivery"){
      return <img className="shopitem_today_start_img" src="data:image/png;base64,"/>
    }else if(ts === "ohouseDelivery"){
      return <img className="shopitem_today_start_img" src="data:image/png;base64,"/>
    }
  }
  return(
    <div className="shopitem_today_start">
      {
        todayStart(ts)
      }
    </div>
  );
}